import React from 'react'
import './components/Crudops.css'
const Crudops=({id,email,name,onDelete,onEdit}) =>{
     const handleDelete=()=>{
         onDelete(id)
     }
  return (
    <div className='list'>
        <span>{name}</span>
        <span>{email}</span>
        <span>
            <button onClick={handleEdit}>Edit</button>
            <button onClick={handleDelete}>Delete</button>
        </span>
    </div>
  )
}

export default Crudops
